INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (1, 1, 0, "みやこ", 2.17, "ミヤコ（クリスマス）", 0, 0, 119901, 0, 119901, 1, 3, 14, 450, 302, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 0, 1, 119901, 119901, "2023/12/22 12:00:00", "2023/12/27 11:59:59", 0);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (5, 1, 0, "しずる", 2.375, "シズル（ノワール）", 0, 0, 120001, 0, 120001, 5, 3, 6, 450, 190, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 0, 1, 120001, 120001, "2024/03/22 12:00:00", "2024/03/28 11:59:59", 0);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (7, 0, 0, "いお", 0.0, "イオ（ノワール）", 0, 0, 0, 0, 120101, 7, 3, 0, 0, 0, "", 0, 0, 120101, 0, "2015/04/01 15:00:00", "2030/12/31 15:00:00", 0);
